import logo from './logo.png';
import vtp6 from './vtp6-logo.png'
import gh from './gh.svg';
import './App.css';

function Description({str}) {
  return (
    <div className="desc">
      <span>{str}</span>
    </div>
  );
}

function LogoName() {
  return (
    <div className="logoname">
      <img className="logo" src={logo} alt="RN"></img>
      <h1 className="name">Rujul Nayak</h1>
    </div>
  );
}

function Links() {
  return (
    <div className="links">
      <a href="https://github.com/nayakrujul" className="link">
        <img className="icon" src={gh} alt="GitHub"></img>
      </a>
      {/* Add LinkedIn when I set it up */}
    </div>
  );
}

function Header() {
  return (
    <div className="header">
      <LogoName></LogoName>
      <Description str="Student studying CompSci, Maths, Further&nbsp;Maths & Physics"></Description>
      <Links></Links>
    </div>
  );
}

function Project({name, img, year, desc, src, demo=null}) {
  return (
    <div className="project">
      <h1 className="title">{name}</h1>
      <img src={img} className="projimg" alt="VTP6"></img>
      <p>{desc}, {year}</p>
    </div>
  )
}

function Content() {
  return (
    <div className="content">
      <Project
        name="VTP6" img={vtp6} year={2023} desc="Website to make learning a language easier for students"
        src="https://github.com/vtp6/vtp6.github.io/" demo="https://vtp6.rujulnayak.com/"
      ></Project>
      <Project
        name="VTP6" img={vtp6} year={2023} desc="Website to make learning a language easier for students"
        src="https://github.com/vtp6/vtp6.github.io/" demo="https://vtp6.rujulnayak.com/"
      ></Project>
      <Project
        name="VTP6" img={vtp6} year={2023} desc="Website to make learning a language easier for students"
        src="https://github.com/vtp6/vtp6.github.io/" demo="https://vtp6.rujulnayak.com/"
      ></Project>
      <Project
        name="VTP6" img={vtp6} year={2023} desc="Website to make learning a language easier for students"
        src="https://github.com/vtp6/vtp6.github.io/" demo="https://vtp6.rujulnayak.com/"
      ></Project>
    </div>
  );
}

function App() {
  return (
    <div className="app">
      <Header></Header>
      <Content></Content>
    </div>
  );
}

export default App;
